/**
 * Different BusyIndicator sizes.
 * @public
 */
enum BusyIndicatorSize {
	/**
	 * small size
	 * @public
	 */
	S = "S",

	/**
	 * medium size
	 * @public
	 */
	M = "M",

	/**
	 * large size
	 * @public
	 */
	L = "L",
}

export default BusyIndicatorSize;
